import Typing from 'react-typing-animation'

const Index = () => (
    <div className='test'>
        <Typing>
            <div>
                <Typing.Delay ms={500} />
                <span className='bio'>
                    For CS students, by CS students.
            </span>
            </div>

        </Typing>

        <style jsx>{`
        h1,
        a {
          font-family: 'Arial';
        }

        ul {
          padding: 0;
        }

        li {
          list-style: none;
          margin: 5px 0;
        }

        a {
          text-decoration: none;
          color: blue;
        }

        a:hover {
          opacity: 0.6;
        }
      `}</style>
    </div>
);

export default Index;
